import {
  StyleSheet,
  Text,
  View,
  ScrollView,
  FlatList,
  TouchableOpacity,
  Image,
  ImageBackground,
  Alert,
  Keyboard,
} from 'react-native';
import React, {useState, useEffect} from 'react';
import styles from '../Styles/GlobalStyles';
import {Card, TextInput} from 'react-native-paper';
import theme from '../Styles/Theme';

const Bollywood = () => {
  const [text, onChangeText] = React.useState('');
  console.log(text);

  useEffect(() => {
    const showSubscription = Keyboard.addListener('keyboardDidShow');
    const hideSubscription = Keyboard.addListener('keyboardDidHide');

    return () => {
      showSubscription.remove();
      hideSubscription.remove();
    };
  }, []);

  const [list, Setlist] = useState([
    {
      id: '1',
      moviename: 'First Movie',
      image:
        'data:image/jpeg;base64,',
    },
    {
      id: '2',
      moviename: 'Second Movie',
      image:
        'data:image/jpeg;base64,',
    },
    {
      id: '3',
      moviename: 'Third Movie',
      image:
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSCSdQ3j6iSIUF9juXMfAnfMtyB2k8JF73m3A&usqp=CAU',
    },
    {
      id: '4',
      moviename: 'Fourth Movie',
      image:
        'data:image/jpeg;base64,',
    },
    {
      id: '5',
      moviename: 'Fifth Movie',
      image:
        'data:image/jpeg;base64,',
    },
    {
      id: '6',
      moviename: 'Sixth Movie',
      image:
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSCSdQ3j6iSIUF9juXMfAnfMtyB2k8JF73m3A&usqp=CAU',
    },
  ]);

  const SearchItem = () => {
    try {
      const filteredData = list.filter(item => item.moviename === text);
      filteredData.map(element => {
        const name = element.moviename;
        Alert.alert(
          'You Searched Movie Whose Name is : ' + name,
          'Choose Options',
          [
            {text: 'Cancel', onPress: () => {}, style: 'cancel'},
            {
              text: 'OK',
              onPress: () => {
                Setlist(filteredData);
                onChangeText('');
              },
              style: 'OK',
            },
          ],
        );
      });
    } catch (e) {
      Alert.alert(e);
    }
  };

  return (
    <View style={styles.container}>
      <View
        style={{
          flex: 0.1,
          //backgroundColor: 'blue',
          flexDirection: 'row',
        }}>
        <TextInput
          style={styles.input}
          onChangeText={onChangeText}
          value={text}
          placeholder="Search Movie"
          onSubmitEditing={Keyboard.dismiss}
        />
        <View
          style={{
            flex: 1.5,
            //backgroundColor: 'yellow',
            alignItems: 'center',
            justifyContent: 'center',
          }}>
          <TouchableOpacity
            style={{
              backgroundColor: 'lightblue',
              borderRadius: 10,
              width: 100,
              marginRight: 40,
            }}
            onPress={() => SearchItem()}>
            <Text style={styles.search}>Search</Text>
          </TouchableOpacity>
        </View>
      </View>
      <View
        style={{
          flex: 0.15,
          alignItems: 'center',
          justifyContent: 'center',
          //backgroundColor: 'yellow',
        }}>
        <Text style={styles.title}>Select Your Bollywood Movie</Text>
      </View>
      <View style={{flex: 0.7}}>
        <ScrollView>
          <FlatList
            data={list}
            keyExtractor={list.id}
            renderItem={({item}) => (
              <View>
                <TouchableOpacity
                  style={{paddingBottom: 20}}
                  onPress={() =>
                    Alert.alert(
                      'You Have Selected The Movie Whose Name is : ' +
                        item.moviename,
                      'Choose Options',
                      [
                        {text: 'Cancel', onPress: () => {}, style: 'cancel'},
                        {
                          text: 'OK',
                          onPress: () => {},
                          style: 'ok',
                        },
                      ],
                    )
                  }>
                  <Card style={{flexDirection: 'row'}}>
                    <Image source={{uri: item.image}} style={styles.image} />
                  </Card>
                </TouchableOpacity>
              </View>
            )}
          />
        </ScrollView>
      </View>
    </View>
  );
};

export default Bollywood;
